B.Kh=new A.ep("@legisweb","05/04/2022",u.E,u.e,null)
B.Kj=new A.ep("@sigafisco","25/04/2022","Resolu\xe7\xe3o prorroga para 31 de maio ades\xe3o ao Relp","Resolu\xe7\xe3o CGSN 168/2022 prorroga para 31 de maio de 2022 o prazo de ades\xe3o ao Relp. A medida j\xe1 tinha sido anunciada dia 20 de abril pelo Comit\xea Gestor do Simples Nacional.\n\nO Relp permite o parcelamento com redu\xe7\xf5es nos valores de juros e multas para os d\xe9bitos apurados no Simples Nacional ou no Simei de per\xedodos de apura\xe7\xe3o (PA) at\xe9 02/2022.",null)
B.Kn=new A.ep("@diaadiatributario","11/04/2022","Ju\xedza permite que empresa retire ISS, PIS e Cofins da base de c\xe1lculo de ISS","Com base na decis\xe3o do Supremo Tribunal Federal que estabeleceu que o ICMS deve ser exclu\xeddo da base de c\xe1lculo do PIS/Cofins, a 12\xaa Vara de Fazenda P\xfablica do Rio de Janeiro concedeu liminar para autorizar a American Bureau of Shipping a retirar os valores de ISS, PIS e Cofins da base de c\xe1lculo do seu ISS.",null)
B.Ko=new A.ep("@guiatributario","18/04/2022","TIPI/2022 \u2013 Decreto Consolida Tabela com Redu\xe7\xf5es de Al\xedquotas","Por meio do Decreto 11.047/2022 foi alterada a Tabela do IPI, com vig\xeancia a partir de 01.05.2022.\n\nA nova tabela j\xe1 contempla as redu\xe7\xf5es das al\xedquotas do IPI, previstas no Decreto 10.979/2022.",null)
B.Ki=new A.ep("@legisweb","05/04/2022",u.E,u.e,null)
B.Kg=new A.ep("@jota","26/04/2022","Decis\xe3o no STF gera corrida por exclus\xe3o da Selic do PIS/Cofins","A decis\xe3o do Supremo Tribunal Federal (STF) que afastou a cobran\xe7a do IRPJ e da CSLL sobre valores referentes \xe0 taxa Selic em raz\xe3o de repeti\xe7\xe3o de ind\xe9bito tribut\xe1rio, isto \xe9, da devolu\xe7\xe3o de um valor pago indevidamente pelo contribuinte, levou a uma corrida de contribuintes ao Judici\xe1rio para defender a n\xe3o incid\xeancia do PIS e da Cofins sobre essas verbas.\n\nO principal argumento dos advogados \xe9 que os valores recebidos a t\xedtulo de Selic n\xe3o representam receita nova para as empresas e, portanto, n\xe3o podem compor a base de c\xe1lculo do PIS e da Cofins.",null)
B.Kk=new A.ep("@ewb","26/04/2022","Transmiss\xe3o da ecd 2022 poder\xe1 gerar alerta","A maior novidade para essa entrega est\xe1 na publica\xe7\xe3o da Nota T\xe9cnica ECD n\xba 001, que disp\xf5e sobre nova regra de transmiss\xe3o da obrigatoriedade relativa \xe0 aptid\xe3o do profissional cont\xe1bil conforme registros do Conselho Federal de Contabilidade \u2013 CFC.\n\nA NT ECD n\xba 001 enfatiza que, de acordo com a legisla\xe7\xe3o em vigor, somente contadores e t\xe9cnicos em contabilidade com registro em um Conselho Regional de Contabilidade \u2013 CRC podem exercer a profiss\xe3o cont\xe1bil e a partir disso, faz um alerta: \u201cECD transmitidas a partir de 2022 poder\xe3o receber um aviso na transmiss\xe3o identificando profissionais cont\xe1beis assinantes da escritura\xe7\xe3o que constam como \u2018inaptos\u2019 segundo os registros do CFC\u201d.",null)
B.Kl=new A.ep("@contadorescnt","26/04/2022","Governo adia envio dos dados de \xf3rg\xe3os p\xfablicos para o eSocial","O governo federal adiou as datas de envio de informa\xe7\xf5es de \xf3rg\xe3os p\xfablicos, bem como das organiza\xe7\xf5es internacionais, para o eSocial.\n\nO grupo gestor do eSocial atendeu pedido de representantes de estados e munic\xedpios que ainda n\xe3o est\xe3o preparados para os compromissos do sistema de escritura\xe7\xe3o digital",null)
B.Kf=new A.ep("@fazendasp","26/04/2022","Em terceiro repasse de ICMS de abril, Sefaz-SP transfere R$ 1,5 bilh\xe3o aos munic\xedpios","A Secretaria da Fazenda e Planejamento do Estado de S\xe3o Paulo (Sefaz-SP) transfere, nesta ter\xe7a-feira (26), R$ 1,53 bilh\xe3o aos caixas dos 645 munic\xedpios paulistas. O dep\xf3sito \xe9 referente ao montante de ICMS arrecadado de 18 a 22 de abril. \n\nOs valores correspondem a 25% da arrecada\xe7\xe3o do imposto, que s\xe3o distribu\xeddos \xe0s administra\xe7\xf5es municipais com base na aplica\xe7\xe3o do \xcdndice de Participa\xe7\xe3o dos Munic\xedpios (IPM) definido para cada cidade.",null)
B.Km=new A.ep("@contabeis","20/04/2022","Banco Central: servidores suspendem greve at\xe9 in\xedcio de maio e aguardam proposta do governo","A greve dos servidores do Banco Central (BC) foi suspensa at\xe9 o in\xedcio de maio. A decis\xe3o da categoria foi anunciada em assembleia realizada nesta ter\xe7a-feira (19). Apesar da pausa, os funcion\xe1rios do BC dizem que dar\xe3o continuidade a paralisa\xe7\xf5es parciais di\xe1rias e \xe0 opera\xe7\xe3o-padr\xe3o iniciada em 17 de mar\xe7o.\n\nOs servidores do BC deram como prazo at\xe9 2 de maio para que o governo apresente uma proposta de aumento salarial melhor do que os 5% oferecidos para todos os servidores federais. ",null)
